import pytest
from lib import *

def test_week1():
  #1.2 - 12
  #Solve the frequent words problem
  freq_words = frequent_words("ACGTTGCATGTCGCATGATGCATGAGAGCT",4)
  assert(sorted(freq_words) == ['CATG', 'GCAT'])
  output = frequent_words("", 14)
  print(' '.join(output))

  print_sep()

  #1.3 - 2
  assert(reverse_complement('AAAACCCGGT') == 'ACCGGGTTTT')
  ans = reverse_complement('')
  write_temp(ans)

  print_sep()

  #1.3 - 5
  assert(pattern_match('GATATATGCATATACTT','ATAT') == [1,3,9])
  ans = pattern_match('', 'CGGATTGCG')
  print(' '.join([str(x) for x in ans]))

  print_sep()

  #1.3 - 6
  #find positions where given seq appears in the cholera genome
  vibrio_cholera_genome = open('inputs/Vibrio_Cholera_Genome.txt','r').read()
  ans = pattern_match(vibrio_cholera_genome, 'CTTGATCAT')
  print(' '.join([str(x) for x in ans]))

  print_sep()
  ans2 = pattern_match(vibrio_cholera_genome, reverse_complement('CTTGATCAT'))
  print(' '.join([str(x) for x in ans2]))

  print_sep()

  #1.4-5
  ans = find_clumps('CGGACTCGACAGATGTGAAGAACGACAATGTGAAGACTCGACACGACAGAGTGAAGAGAAGAGGAAACATTGTAA', 5, 50, 4)
  print(ans)
  assert(ans == ['CGACA', 'GAAGA'])
  text = ''
  ans = find_clumps(text, k=10, L=26, t=4)
  print(ans)

  print_sep("Find how many 9-mers form (500,3) clumps in the E. Coli Genome (4.6ßMB!)")

  ecoli_genome = open('inputs/E_coli_genome.txt','r').read()
  ans = find_clumps(ecoli_genome, k=9, L=500, t=3)
  write_temp(' '.join(ans))
  print(len(ans))

  print_sep("Coursera Quiz 1")

  # Quiz 1
  s = 'TAAACGTGAGAGAAACGTGCTGATTACACTTGTTCGTGTGGTAT'
  print(frequent_words(s,3))

  s = 'AAACATAGGATCAAC'
  print(pattern_match(s,"AA"))


  print("all assertions passed!")

if __name__ == '__main__':
  pytest.main(["-s", __file__]) #-s to not suppress prints